/********** TEXT FUNCTIONS **********/
drawLetter = function(ch,co) {
  var cVal = (co>='1' && co<='4')?co-'1':Math.floor(Math.random()*4);
  var tVal = (characters.indexOf(ch)>-1)?characters.indexOf(ch):0;
  var letter = document.createElement("img");
  if (tVal == 0) cVal = 0;
  letter.setAttribute("src", letters[cVal][tVal]);
  letter.setAttribute("alt", "Google");
  letter.addEventListener("dblclick", function(e) {showBox()}, false);
  if (igoogle_page>0) {
    if (letter.height>1)
      letter.setAttribute("height", letter.height/2);
    if (letter.width>1)
      letter.setAttribute("width", letter.width/2);    
  }
  img.parentNode.insertBefore(letter, img);
  imgBegin++;
  imgEnd++;
  return tVal;
}

clearText = function() {
  if (imgBegin==-1)
    return;
  for (var i=imgEnd; i>=imgBegin; i--)
    imglist[i].parentNode.removeChild(imglist[i]);
}

showText = function() {
  var count = 0, found = 0; 
  imgBegin = -1;
  imgEnd = -1;
  igoogle_logo = -1;
  imglist = document.getElementsByTagName("img");
  for(var i=0; i<imglist.length; i++) { // Find at www.google.com 
    if (imglist[i].getAttribute("alt")=="Google") {
      if (imgBegin == -1)
        imgBegin = i;
	  imgEnd = i;
  } }
  if (imgBegin == -1) { // if not found
    imglist = document.getElementsByTagName("br"); // Find at www.google.ie
    for(var i=0; i<imglist.length; i++) {
      if (imglist[i].getAttribute("id")=="lgpd") {
        imgBegin = i+1;
        imgEnd = i+1;
        break;
    } }
    if (imgBegin != -1) { // if found
      var imglist2 = document.getElementsByTagName("div"); 
      for(var i=0; i<imglist2.length; i++) {
        if (imglist2[i].getAttribute("title")=="Google") {
          imglist2[i].parentNode.removeChild(imglist2[i]);
          break;
    } } }
    else { // if not found
      imglist = document.getElementsByTagName("div"); // Find at igoogle
      for(var i=0; i<imglist.length; i++) {
        if (imglist[i].getAttribute("id")=="regular_logo") { // if found
          imgBegin = i;
          imgEnd = i;
          igoogle_logo = i;
          igoogle_page = 1;
          found = 1;
          break;
      } }
      if (imgBegin==-1) // if not found
        return;
  } }
  else found = 1;
  img = imglist[imgBegin];
  for (var j=0; j<t.length; j++)
    count+=drawLetter(t[j],(j<c.length)?c[j]:0);
  if (igoogle_logo >- 1)
    imgBegin = imgEnd = igoogle_logo;
  if (found == 1)
    clearText();
  if (count == 0) {
    t = "Google";
    c = "123142";
    GM_setValue('title',t);
    GM_setValue('color',c);
    showText();
  }
}

redoText = function(txt, cor) {
  t = txt;
  c = cor;
  showText();
}

/********** BOX FUNCTIONS **********/
function storeConfig() {
  var title = document.getElementById('GT_title');
  var color = document.getElementById('GT_color');
  if (title.value.length < 1) {
    title.value = "Google";
    color.value = "123142";
  }
  GM_setValue('title',title.value);
  GM_setValue('color',color.value);
  redoText(title.value, color.value);
}

function hideBox() {
  var box = document.getElementById('GT_config');
  if (box) box.parentNode.removeChild(box);
}

function showBox() {
  var box = document.getElementById('GT_config');
  if (box != null) hideBox();
  box = document.createElement("box");
  box.setAttribute("id", "GT_config");
  box.setAttribute("style", "display:block;z-index:1000;position:fixed;overflow:auto;left:40%;top:50px;width:200px;height:100px;background-color:silver;padding:10px;border:1px solid black");
  document.body.appendChild(box);
  if (!document.getElementById('GT_config')) {
    alert("Error!");
    return;
  }
  var s='';
  s+="<table cellspacing='0' cellpadding='0'>";
  s+="<tr><td style='font-weight:bold;' width=70>Title:</td>";
  s+="<td><input id='GT_title' type='text' size='15' value='"+t+"'/></td></tr>";
  s+="<tr><td style='font-weight:bold;' width=70>Color:</td>";
  s+="<td><input id='GT_color' type='text' size='15' value='"+c+"'/></td></tr>";
  s+="<tr><td>&nbsp;</td></tr>";
  s+="<tr><td colspan=2><center><button id='GT_change'>Change</button><button id='GT_cancel'>Cancel</button></center></td></tr>";
  s+="</table>";
  box.innerHTML = s;

  document.getElementById('GT_change').addEventListener('click', function(e) {storeConfig(); hideBox()}, false);
  document.getElementById('GT_cancel').addEventListener('click', function(e) {hideBox()}, false);
}

/********** START CODE **********/
showText();